const selectAnim=document.getElementById("selectAnim")
const animalsBox=document.getElementById("animalsBox")

const animals=[
    {
        name:"Cat",
        image:["https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSDTOh2S8PF_C281-xY8k4H5vanQ6_GSnS5Mg&s", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQ31-OE4i9ST8qidcOnOnmfNJNHzfPfHWszGg&s", "https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSwXob3c6JZ2ge1V03stHEcibi4bA46wfskCQ&s"]
    },
    {
        name:"Dog",
        image:["data:image/jpeg;base64,", "data:image/jpeg;base64,"]
    },
    {
        name:"Elephant",
        image:["data:image/jpeg;base64,", "data:image/jpeg;base64,"]
    },
    {
        name:"Lion",
        image:["data:image/jpeg;base64,", "data:image/jpeg;base64,"]
    }
]

const showAnimals=(animals)=>{
    animals.forEach(animal=>{
        animal.image.forEach(imgLink=>{
            const imageDiv=document.createElement("div")
            const image=document.createElement("img")
            image.src=imgLink
            imageDiv.appendChild(image)
            animalsBox.appendChild(imageDiv)
        })
    })
}

const selectAnimFun=()=>{
    animalsBox.innerHTML=""
    const animalName=selectAnim.value
    filteredAnimal=animals.filter(el=>el.name===animalName)
    console.log(filteredAnimal);
    
    return showAnimals(filteredAnimal)
}
selectAnim.addEventListener("click", selectAnimFun)